ln -s "Versions/Current/${PRODUCT_NAME}" "${FRAMEWORK}/${PRODUCT_NAME}" &amp;&amp;
cp "${SRCROOT}/${PROJECT_NAME}-Info.plist" "${FRAMEWORK}/Resources/Info.plist"

